$.ai5=function(){var t=u.X
return P.D(["en","The logic of writing a number by a limited set of symbols allows the use of any number of symbols.\nThe binary system (base 2) and the hexadecimal system (base 16) are widely used in the computer area and are related to the number of digital signals (on and off) in the case of the binary system or the limit on the number of digits in the number , in the case of the hexadecimal system with limits of 4 or 8.\n\n  ","pt","A l\xf3gica em se escrever um n\xfamero por um conjunto limitado de s\xedmbolos permite a utiliza\xe7\xe3o de qualquer quantidade de s\xedmbolos.\nO sistema bin\xe1rio (base 2) e o sistema hexadecimal (base 16) s\xe3o muito utilizado na \xe1rea de inform\xe1tica e est\xe3o relacionados \xe0 quantidade de sinais digitais (ligado e desligado) no caso do sistema bin\xe1rio ou com o limite na quantidade de d\xedgitos do numero, no caso do sistema hexadecimal com limites de 4 ou 8.\n\n  "],t,t)}()
