$.ai8=function(){var t=u.X
return P.D(["en","Why are the numbers drawn as we know them today?\n  ","pt","Porque os n\xfameros s\xe3o desenhados como conhecemos hoje?\n  "],t,t)}()
$.ahY=function(){var t=u.X
return P.D(["en","Like all human communication, the numbers were influenced by various peoples, who, according to their needs, proposed adjustments that over time were incorporated into the symbols we use today.\nOne of the initial explanations is that at the beginning the symbols were more angular and due to the number of angles formed, they indicated their value. The zero, being circular has no angle. This facilitated the understanding of its symbology and consequently, in a short time, it was possible to decorate its symbols.\nOver time, numbers began to be used by many people so that these 10 symbols were part of the language to the point that they could be designed differently without losing their understanding.\nIn this process, the drawings of the numbers started to be more rounded until the beginning of the digital age, where it was necessary to adapt the symbols to the devices and visual indicators. At this time the symbols appeared:\n\n  ","pt","Como toda comunica\xe7\xe3o humana, os n\xfameros receberam influ\xeancia de v\xe1rios povos, que conforme suas necessidades propunham adequa\xe7\xf5es que com o tempo foram incorporadas aos s\xedmbolos que utilizamos hoje.\nUma das explica\xe7\xf5es iniciais \xe9 de que no inicio os s\xedmbolos eram mais angulares e pela quantidade de \xe2ngulos formados, indicavam seu valor. O zero, sendo circular n\xe3o possui \xe2ngulo. Isto facilitava o entendimento de sua simbologia e consequente em pouco tempo era poss\xedvel decorar seus s\xedmbolos.\nCom o tempo, os n\xfameros passaram a ser utilizados por muitas pessoas de forma que estes 10 s\xedmbolos faziam parte da linguagem a ponto de poderem ser desenhados de forma diferente sem perda do seu entendimento.\nNeste processo os desenhos dos n\xfameros passaram a ser mais arredondados at\xe9 o inicio da era digital, onde foi necess\xe1rio adequar os s\xedmbolos aos dispositivos e indicadores visuais. Nesta \xe9poca que surgiu os s\xedmbolos:\n\n  "],t,t)}()
